var canvas=document.getElementById("index_canvas");
canvas.width=window.innerWidth;
canvas.height=window.innerHeight;
let particles = [];
ctx=canvas.getContext('2d');
//mouse 
let mouse = {
    x:null,
    y:null,
    radius:50
};
let bound = canvas.getBoundingClientRect();
window.addEventListener("mousemove",(e)=>{
    mouse.x = e.clientX - bound.left - canvas.clientLeft;
    mouse.y = e.clientY - bound.top - canvas.clientTop;;
})
//
var png = new Image();
png.src = "data:image/svg+xml;base64,";
png.addEventListener("load",()=>{
    ctx.drawImage(png,0,0);
    let imageWidth = png.width;
    let imageHeight = png.height;
    const data = ctx.getImageData(0,0,200,200);
    ctx.clearRect(0,0,canvas.width,canvas.height);
    let offset={
        x:canvas.width/2-png.width-500,
        y:canvas.height/2-png.width-70
    }
   let scale={
       x:3,
       y:3
   }

//


let TextParticles = [];

ctx.fillStyle = "white";
ctx.font = "23px Verdana";
ctx.fillText("vgath 8086",0,40);
let textCoordinate = ctx.getImageData(0,0,200,100);
//
function initParticlesText()
{
    TextParticles = [];
    
  for(let y=0,y2=textCoordinate.height;y<y2;y++)
  {
    for(let x=0,x2=textCoordinate.width;x<x2;x++)
    {
        let opacityCellInPixelIndex=y*4*textCoordinate.width+x*4+3;
        if(textCoordinate.data[opacityCellInPixelIndex]>128)
        {
            TextParticles.push(new TextParticle(x*5+500,y*5+200));
        }
  
    }
  }
}

//





//


   

function animate()
{


    requestAnimationFrame(animate);
    ctx.fillStyle="rgba(0,0,0,1)";
    ctx.fillRect(0,0,canvas.width,canvas.height);
    for(let i=0;i<particles.length;i++)
    {
        particles[i].update();
    }
    //
    
    for(let i=0;i<TextParticles.length;i++)
    {
        TextParticles[i].update();
        TextParticles[i].draw();
    }

    //
}
function init()
{
    particles = [];
    var k=0;
    for(let y=0,y2=data.height;y<y2;y++)
    {
        for(let x=0,x2=data.width;x<x2;x++)
        {
            if(data.data[k+3]>128)
            {
                let color = "rgb("+
                data.data[k]+","+
                data.data[k+1]+","+
                data.data[k+2]+")";
                particles.push(new ImageParticle(x*scale.x+offset.x,y*scale.y+offset.y,color));
            }
          

            k+=4;
        }
    }
}
init();
initParticlesText();
animate();

   

})









